import React from 'react';
import { Navbar, NavItem, Icon, Button } from 'react-materialize';

function Header() {
    return (
        <Navbar
            alignLinks="right"
            brand={<a className="brand-logo" href="/">Well ToDo</a>}
            id="mobile-nav"
            menuIcon={<Icon>menu</Icon>}
            options={{
                draggable: true,
                edge: 'left',
                inDuration: 250,
                onCloseEnd: null,
                onCloseStart: null,
                onOpenEnd: null,
                onOpenStart: null,
                outDuration: 200,
                preventScrolling: true
            }}
        >
            <NavItem href="/">
                Sign In
            </NavItem>
            <NavItem href="/">
                Sign Up
            </NavItem>
        </Navbar>
    );
}

export default Header;
